import { useIsFocused } from "@react-navigation/native";
import React, { useState } from "react";
import {
  ScrollView,
  View,
  Text,
  StyleSheet,
  KeyboardAvoidingView,
  Platform,
  Pressable,
  StatusBar,
} from "react-native";
import { SvgXml } from "react-native-svg";
import { useDispatch, useSelector } from "react-redux";
import IconButton from "../../components/IconButton";
import Input from "../../components/Input";
import AnimatedHeight from "../../Hooks/AnimatedHeight";
import ViewMore from "../../Hooks/ViewMore";
import { setHideBottomBar } from "../../Reducers/hideBottomBar";

export default function BusinessTitle({ navigation }) {
  const businessForm=useSelector(state=>state.businessForm)
  const [name, setName] = useState(businessForm?.serviceCenterName);
  const [nameError, setNameError] = useState();
  const [layoutHeight,setLayoutHeight]=useState(0)
  const isFocused=useIsFocused()
  const dispatch=useDispatch()
  React.useEffect(() => {
    if (isFocused) {
      //console.log("hidden")
      dispatch(setHideBottomBar(true));
      setTimeout(() => {
        dispatch(setHideBottomBar(true));
      }, 50);
    } else {
      //console.log("seen")
      dispatch(setHideBottomBar(false));
    }
  }, [isFocused]);
  //console.log(businessForm)

  return (
    <KeyboardAvoidingView
      style={{ flex: 1 }}
      behavior={Platform.OS === "ios" ? "padding" : null}
      keyboardVerticalOffset={Platform.OS === "ios" ? 80 : 0}>
        
      <ScrollView showsVerticalScrollIndicator={false}>
        <View
          style={{
            marginHorizontal: 20,
          }}>
          <SvgXml
            style={{
              marginTop: 24,
            }}
            width={"100%"}
            xml={vectorImage}
          />
          <View
            style={{
              flexDirection: "row",
              marginTop: 36,
            }}>
            <SvgXml
              style={{
                marginRight: 8,
              }}
              xml={icon}
            />
            <Text style={[styles.headLine,{flex:1}]}>
              Tips for set up the service center name
            </Text>
          </View>
          <ViewMore
            style={{
              marginTop: 24,
            }}
            
            width={"37%"}
            height={layoutHeight}
            component={<Text onLayout={e=>{
              setLayoutHeight(e.nativeEvent.layout.height)
            }} style={[styles.spText,{marginTop:0}]}>
              Please enter the name of your{" "}
              <Text style={{ fontWeight: "700" }}>brand or company</Text> in the
              service name form.{" "}
              <Text style={{ fontWeight: "700" }}>
                If you're an individual providing services
              </Text>
              , you may use your personal name or a brand name of your choice.
              This name will be displayed on your profile and will be used to
              promote your services to potential buyers. Ensure the name
              accurately reflects your services and does not infringe on others'
              rights. Thank you for choosing our platform!"
            </Text>}
          />
          
          <Text
            style={[
              styles.headLine,
              {
                marginTop: 36,
              },
            ]}>
            Service Center Name
          </Text>
          <Input
            error={nameError}
            value={name}
            onChange={setName}
            style={styles.input}
            placeholder={"Type of your service center or brand name"}
          />
          <Text style={styles.text}>Max 50 characters </Text>
          <IconButton
            onPress={() => {
              setNameError();
              if (!name) {
                setNameError("*Service center name is required");
                return;
              }
              if (name?.split("")?.length > 50) {
                setNameError("*Max text size is 50 character");
                return;
              }
              dispatch({ type: "SERVICE_CENTER_NAME", playload: name });
              navigation.navigate("YourInformation", {
                serviceCenterName: name,
              });
            }}
            active={name?true:false}
            disabled={!name?true:false}
            style={styles.button}
            title={"Continue"}
          />
        </View>
      </ScrollView>
    </KeyboardAvoidingView>
  );
}
